import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.section`
  border: 1.5px solid #FEA82F;
  border-radius: 10px;


`;

const Summary = (props) => {
  return <>
  <Wrapper>
    <div className="qwer">

    </div>
    <img src="assets/images/summary.png" alt="img" />
    <h1>temp</h1>
  </Wrapper>
    
  </>;
};

export default Summary;
